css:
.git-diff-details-outer {
  background-color: #455564;
  outline: 2px solid #788a9c;
  width: 100%;
  min-width: 400px;
}
.git-diff-details-outer .git-diff-details-main-panel {
  position: relative;
}
.git-diff-details-outer .git-diff-details-main-panel .editor.git-diff-editor {
  background-color: #ffffff;
}
.git-diff-details-outer .git-diff-details-button-panel {
  text-align: right;
  padding: 2px;
  width: 100%;
}
